import * as Icon from '../components/icon'
import React from 'react'

export default {
    MOBILE_SIZE: 700,
    TABLET_SIZE: 925,
}
const MENU = [
    {
        key: 'twitter',
        icon: <Twitter />,
        iconSelected: <Twitter />,
        title: '',
    },
    {
        key: 'home',
        icon: <Home />,
        iconSelected: <HomeFill />,
        title: 'Home',
    },
    {
        key: 'explore',
        icon: <Basket />,
        iconSelected: <BasketFill />,
        title: 'Explore',
    },
    {
        key: 'notification',
        icon: <Notification />,
        iconSelected: <NotificationFill />,
        title: 'Notification',
    },
    {
        key: 'messages',
        icon: <Profile />,
        iconSelected: <ProfileFill />,
        title: 'Messages',
    },
    {
        key: 'bookmark',
        icon: <SettingsFill />,
        iconSelected: <Settings />,
        title: 'Bookmark',
    },
]
